  false,\n\t\"url\": null,\n\t\"notes\": \"The Midwater Assessment and Conservation
  Engineering (MACE) program of NOAA National Marine Fisheries Service (NMFS), Alaska
  Fisheries Science Center (AFSC) conducted acoustic-trawl (AT) stock assessment surveys
  in the Bogoslof Island area of the southeastern Aleutian Basin during late winter
  of 2016 to estimate the distribution and abundance of walleye pollock (Gadus chalcogrammus).
  The surveys were conducted 4-8 March, departing from Kodiak, Alaska (2 March) and
  included the Umnak and Samalga Pass area. The vessel returned to the Kodiak, Alaska
  area on 13 March to exchange scientific personnel and depart for the following cruise
  (Gulf of Alaska/Shelikof Strait survey, 14-21 March, cruise DY1604). The survey
  was conducted aboard NOAA Ship Oscar Dyson, a 64 meter stern trawler equipped with
  acoustic and oceanographic instrumentation.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
